import React from "react";
import { Box, Typography, Select, MenuItem } from "@mui/material";

interface ChampionHeaderProps {
  name: string;
  winrate: number;
  pickrate: number;
  banrate: number;
}

const ChampionHeader: React.FC<ChampionHeaderProps> = ({ name, winrate, pickrate, banrate }) => {
  return (
    <Box
      sx={{
        p: 1,
        backgroundColor: "#091428",
        borderRadius: "8px",
        my: 2,
        display: "flex",
        alignItems: "center",
        justifyContent: "space evenly",
        flexWrap: "wrap",
        gap: "0",
        paddingLeft: "5%",
        color: "#F0E6D2"
      }}
    >
      <Typography variant="h4">{name.toLocaleUpperCase()}</Typography>
      <Box sx={{ display: "flex", alignItems: "center", gap: 2 }}>
        <Select defaultValue="challenger" size="small" sx={{ color: "#F0E6D2", borderRadius: "4px", border: "1px solid #ccc",".MuiSelect-icon": {color: "white",}, }}>
          <MenuItem value="challenger">Challenger</MenuItem>        
          <MenuItem value="gold">Gold</MenuItem>
          <MenuItem value="silver">Silver</MenuItem>
          <MenuItem value="bronze">Bronze</MenuItem>
       </Select>
        <Typography variant="body1">Winrate: {winrate}%</Typography>
        <Typography variant="body1">Pickrate: {pickrate}%</Typography>
        <Typography variant="body1">Banrate: {banrate}%</Typography>
      </Box>
    </Box>
  );
};

export default ChampionHeader;
